    return (
        <div className="App">
            <header className="App-header">
                <h1>
                    Contact Us

                </h1>
            </header>

                <h2>Interested in joining DayDream Magazine?</h2>
                <img class=".image-container" src={"TempIcons.png"}width={700} height={300}></img>
